@dev Gets the balance of a specific token in the Cluster
@param token The address of the ERC20 token to get the balance of
@return The current token balance in the Cluster

@dev Allows the admin to withdraw a specific amount of tokens to a given address
@param token The address of the ERC20 token to withdraw
@param to The address to send the tokens to
@param amount The amount of tokens to withdraw
@notice Only callable by the admin of the Cluster

@title ICluster interface
@dev Defines the interface for the Cluster contract
@notice Clusters are containers for tokens in the system,
        with an admin who can withdraw tokens
